            int yOffLeft = PosY + 13;
            int yOffRight = PosY + 30;
            Vector2 leftLarge = new Vector2(xOffLeft, yOffLeft);
            Vector2 rightLarge = new Vector2(xOffRight, yOffRight);
            //i = vertical, j = horizontal
            for (int confirmPlatforms = 0; confirmPlatforms < 2; confirmPlatforms++)    //Increase the iterations on this outermost for loop if tabletop-objects are not properly spawning
            {
                for (int i = 0; i < _structure.GetLength(0); i++)
                {
                    for (int j = _structure.GetLength(1) - 1; j >= 0; j--)
                    {
                        int k = PosX + j;
                        int l = PosY + i;
                        if (WorldGen.InWorld(k, l, 30))
                        {
                            Tile tile = Framing.GetTileSafely(k, l);
                            switch (_structure[i, j])
                            {
                                case 0:
                                    tile.active(true);
                                    tile.TileType = (ushort)ModContent.TileType<Tiles.TuhrtlBrick>();
                                    tile.slope(0);
                                    tile.halfBrick(false);
                                    tile.WallType = (ushort)ModContent.WallType<Walls.TuhrtlBrickWallUnsafe>();
                                    break;
                                case 1:
                                    if (confirmPlatforms == 0)
                                    {
                                        tile.active(false);
                                        tile.halfBrick(false);
                                        tile.slope(0);
                                    }
                                    break;
                            }
                        }
                    }
                }
            }
            List<Vector2> list = new List<Vector2>() { leftLarge, rightLarge };
            return list;
        }

